let smokeh = parcel.getFeatureById('smokeh');

let r1 = smokeh.createAnimation('rotation');


r1.setKeys([{
frame: 30, 
value: smokeh.rotation.add( new Vector3(1,2,3))
}])

smokeh.startAnimations( [r1] );

